type ControlProps = {
    label?: string;
};

const con = [
    {label: 'Cheese', type: 'cheese'},
    {label: 'Cheese', type: 'cheese'},
    {label: 'Cheese', type: 'cheese'},
    {label: 'Cheese', type: 'cheese'}
];

const control: React.FC<ControlProps> = (props) => {
    return <>
        <span>{props.label}</span>
        <button>+</button>
        <button>-</button>
    </>
};

export default control;
